const Header = (props) => {
  console.log(props);
  return (
    <div>
      <p>The course name is {props.course}</p>
    </div>
  );
};

const Part = (props) => {
  console.log(props);
  return (
    <p>
      {props.parts}
    </p>
  );
};

const Content = (props) => {
  return (
    <div>
      <p>The part name is <Part part={props.parts[0]} />, and the number of exercises of this part
      is {props.part.exercises}</p>
      <Part part={props.parts[1]} />
      <Part part={props.parts[2]} />
    </div>
  );
};
const Total = (props) => {
  return (
    <div>
      <Part part={props.parts[0]} />
      <Part part={props.parts[1]} />
      <Part part={props.parts[2]} />
    </div>
  );
};
const App = () => {
  const course = 'Half Stack application development';
  const parts = [
    { name: 'Fundamentals of React', exercises: 10 },
    { name: 'Using props to pass data', exercises: 7 },
    { name: 'State of a component', exercises: 14 }
  ];

  return (
    <div>
      <Header course={course} />
      <Content parts={parts} />
    </div>
  );
};

export default App;
